import React, { Component } from "react";
import "./Quotebox.js";
import "./App.css";
import Button from "./components/Button.js";

class App extends Component() {
  nextQuoteClickHandler() {
    console.log("hi");
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div className="quote-box">
            <p className="quote">
              This is a hardcoded quote until i get the stying done.
            </p>
            <p className="author">me</p>
            <Button
              buttonDisplayName="Another Quote"
              clickHandler={this.nextQuoteClickHandler}
            />
          </div>
        </header>
      </div>
    );
  }
}
export default App;
